  onFileChange(event) {
    if (event.target.files.length > 0) {
      var length = event.target.files.length;

      for (let index = 0; index < length; index++) {
        const file = event.target.files[index];
        var contentType = file.type;

        if (contentType === "application/pdf") {
          contentType = ".pdf";
        } else if (contentType === "image/png") {
          contentType = ".png";
        } else if (contentType === "image/jpeg") {
          contentType = ".jpeg";
        } else if (contentType === "image/jpg") {
          contentType = ".jpg";
        }

        this.myFiles.push(event.target.files[index].name); // alert(this.myFiles.length);

        console.log(this.myFiles, "attach"); //_lstMultipleFiales

        var d = new Date().valueOf();
        this._lstMultipleFiales = [...this._lstMultipleFiales, {
          UniqueId: d,
          FileName: event.target.files[index].name,
          Size: event.target.files[index].size,
          Files: event.target.files[index]
        }];
      }
    }

    document.getElementById("uploadFile").value = "";
  }

